import React from 'react';
import {
  Box,
  Grid,
  Card,
  CardContent,
  Typography,
  Button,
  LinearProgress,
  Avatar,
  List,
  ListItem,
  ListItemText,
  ListItemAvatar,
} from '@mui/material';
import {
  TrendingUp as ProgressIcon,
  Event as EventIcon,
  Psychology as CoachingIcon,
  Book as JournalIcon,
} from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';
import { useNotifications } from '../contexts/NotificationContext';

const Dashboard: React.FC = () => {
  const navigate = useNavigate();
  const { user } = useAuth();
  const { showNotification } = useNotifications();

  const upcomingSessions = [
    {
      id: '1',
      title: 'Leadership Strategy Session',
      coach: 'Dr. Sarah Wilson',
      time: '2:00 PM Today',
      type: 'human',
    },
    {
      id: '2',
      title: 'Goal Review',
      coach: 'AI Coach',
      time: '10:00 AM Tomorrow',
      type: 'ai',
    },
  ];

  const progressMetrics = [
    {
      name: 'Leadership Skills',
      progress: 75,
      color: '#2196f3',
    },
    {
      name: 'Communication',
      progress: 85,
      color: '#4caf50',
    },
    {
      name: 'Decision Making',
      progress: 60,
      color: '#ff9800',
    },
  ];

  const recentJournals = [
    {
      id: '1',
      title: 'Weekly Reflection',
      date: '2 days ago',
      mood: 'Positive',
    },
    {
      id: '2',
      title: 'Leadership Challenge',
      date: '4 days ago',
      mood: 'Neutral',
    },
  ];

  return (
    <Box sx={{ p: 3, maxWidth: 1200, margin: '0 auto' }}>
      <Grid container spacing={3}>
        {/* Welcome Section */}
        <Grid item xs={12}>
          <Card sx={{ mb: 3, bgcolor: 'primary.main', color: 'primary.contrastText' }}>
            <CardContent>
              <Typography variant="h4" gutterBottom>
                Welcome back, {user?.name || 'Coach Seeker'}
              </Typography>
              <Typography variant="subtitle1">
                Your journey to better leadership continues
              </Typography>
            </CardContent>
          </Card>
        </Grid>

        {/* Quick Actions */}
        <Grid item xs={12} md={4}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Quick Actions
              </Typography>
              <Button
                fullWidth
                variant="outlined"
                startIcon={<CoachingIcon />}
                onClick={() => navigate('/coaching')}
                sx={{ mb: 2 }}
              >
                Start Coaching Session
              </Button>
              <Button
                fullWidth
                variant="outlined"
                startIcon={<JournalIcon />}
                onClick={() => navigate('/journal')}
              >
                New Journal Entry
              </Button>
            </CardContent>
          </Card>
        </Grid>

        {/* Progress Tracking */}
        <Grid item xs={12} md={8}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Development Progress
              </Typography>
              {progressMetrics.map((metric) => (
                <Box key={metric.name} sx={{ mb: 2 }}>
                  <Typography variant="body2" gutterBottom>
                    {metric.name}
                  </Typography>
                  <LinearProgress
                    variant="determinate"
                    value={metric.progress}
                    sx={{
                      height: 8,
                      borderRadius: 4,
                      bgcolor: 'grey.200',
                      '& .MuiLinearProgress-bar': {
                        bgcolor: metric.color,
                      },
                    }}
                  />
                </Box>
              ))}
            </CardContent>
          </Card>
        </Grid>

        {/* Upcoming Sessions */}
        <Grid item xs={12} md={6}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Upcoming Sessions
              </Typography>
              <List>
                {upcomingSessions.map((session) => (
                  <ListItem key={session.id}>
                    <ListItemAvatar>
                      <Avatar sx={{ bgcolor: session.type === 'human' ? 'primary.main' : 'secondary.main' }}>
                        <EventIcon />
                      </Avatar>
                    </ListItemAvatar>
                    <ListItemText
                      primary={session.title}
                      secondary={`${session.coach} â€¢ ${session.time}`}
                    />
                  </ListItem>
                ))}
              </List>
            </CardContent>
          </Card>
        </Grid>

        {/* Recent Journal Entries */}
        <Grid item xs={12} md={6}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Recent Journal Entries
              </Typography>
              <List>
                {recentJournals.map((journal) => (
                  <ListItem key={journal.id}>
                    <ListItemAvatar>
                      <Avatar>
                        <JournalIcon />
                      </Avatar>
                    </ListItemAvatar>
                    <ListItemText
                      primary={journal.title}
                      secondary={`${journal.date} â€¢ Mood: ${journal.mood}`}
                    />
                  </ListItem>
                ))}
              </List>
            </CardContent>
          </Card>
        </Grid>
      </Grid>
    </Box>
  );
};

export default Dashboard;
